import React from "react";
import "./App.css";
import Heading from "./main-page/Heading";
import NavBar from "./components/Nav";
import Projects from "./main-page/Projects";

function App() {
  return (
    <>
      <NavBar />
      <Heading />
      <div id="projects">
        <Projects />
      </div>
    </>
  );
}

export default App;
